import React from "react";
import Header from "../header/Header";
import "./ManageItem.css";

const ManageItem = () => {
  return (
    <div className='container'>
      <Header />
      <div className='manageItem'>
        <h2>Manage Post</h2>
        <li className='manageItem__list'>
          <input type='checkbox' name='check' />
          <div className='manageItem__list__item'>
            <div className='manageItem__list__item__left'>
              <img
                src='https://images-na.ssl-images-amazon.com/images/I/71h6PpGaz9L._AC_SL1500_.jpg'
                alt=''
              />
              <div className='manageItem__list__item__info'>
                <p>Laptop</p>
                <p>$500</p>
              </div>
            </div>
            <div className='manageItem__list__item__right'>
              <p>Published Date: 24.Dec.2021</p>
            </div>
          </div>
        </li>
      </div>
    </div>
  );
};

export default ManageItem;
